pragma solidity 0.8.9;

import "../interfaces/IStakingPoolFactory.sol";
import "../interfaces/IStakingPool.sol";
import "../library/StakingLibrary.sol";


contract Auxilary {

    IStakingPoolFactory public immutable stakingPoolFactory;

    constructor(address factory){
        stakingPoolFactory = IStakingPoolFactory(factory);
    }

    function getProjectsDetail(uint256 from, uint256 length) public view
        returns (StakingLibrary.PoolFullInfo[] memory)
        {
        
        require(from > 0 && length > 0, "Not Alllowed");
        require(address(stakingPoolFactory) != address(0), "Staking factory not set" );

        if(from <= length){
            length = from;
        }

        StakingLibrary.PoolFullInfo[] memory fullData = new StakingLibrary.PoolFullInfo[](length);
        uint8 index = 0;

        for(uint256 i = from; i > from - length; i--){
            address poolAddr = stakingPoolFactory.getPoolByID(i);
            StakingLibrary.PoolFullInfo memory poolFullInfo = IStakingPool(poolAddr).getProjectInfo();
            fullData[index] = poolFullInfo;
            index++;
        }
        return fullData;

    }

}
